import SearchResult from "./SearchResult";
import Pagination from "react-js-pagination";

const Results = (props) => {
    const lowestPage = ((props.activePage - 1) * 10) + 1;
    const highestPage = props.activePage * 10;
    const {data, pagination} = props.data;

    return (
        <>
            <p className="dim-text">Showing {pagination.total > 100 ? 100 : pagination.total} results for "{props.activeSearch}"</p>
            {data && data.map(item => {
                return(
                    <SearchResult key={item.image_id} title={item.title} description={item.description} imageID={item.image_id} />
                )
            })}
            <div className="d-flex align-items-center justify-content-center text-center">
                <Pagination
                    activePage={props.activePage}
                    totalItemsCount={pagination.total > 100 ? 100 : pagination.total}
                    itemsCountPerPage={10}
                    onChange={props.setActivePage}
                    itemClass="page-item"
                    linkClass="page-link"
                    innerClass="pagination"
                />
            </div>
            <div className="d-flex align-items-center justify-content-center text-center">
                <p>Showing results {lowestPage} - {highestPage}</p>
            </div>
        </>
    )
}

export default Results;
